import { Waveform } from './../Animation/Waveform';

export const CardWaveform = () => {
  const image = <Waveform />;
  const description = 'Learn about different waveforms';
  const navLink = 'List';

  return (
    <>
      <SharedCard image={image}  description={description} navLink={navLink} nextButton={nextButton}/>
    </>
  );
};
